import React from 'react';

const Logo = ({ className = '' }) => {
  return (
    <div className={`flex items-center relative ${className}`}>
      <span 
        className="text-3xl font-bold uppercase tracking-tight relative z-10"
        style={{ 
          color: '#EB422B',
          fontFamily: 'system-ui, -apple-system, sans-serif',
          letterSpacing: '-0.02em',
        }}
      >
        DARE
      </span>
      <div 
        className="absolute left-16 top-0 px-2.5 py-1.5"
        style={{ 
          backgroundColor: '#EB422B',
          transform: 'rotate(3deg) translateY(-2px)',
          zIndex: 20,
        }}
      >
        <span 
          className="text-3xl font-bold lowercase text-black block"
          style={{
            fontFamily: 'system-ui, -apple-system, sans-serif',
          }}
        >
          now
        </span>
      </div>
    </div>
  );
};

export default Logo;
